const Note = ({ note }) => {
  return (
    <li>{note.content}</li>
  )
}

function App(props) {

  const { notes } = props

  return (
    <div >
    <h1>Notes</h1>
    <ul>
      {notes.map(note =>
        <li key={note.id}>{ note.content}</li>
      )}
    </ul>
    </div>
  );
}

export default App;
